import React from 'react';
import Select from 'react-select';
import { letters } from './dropdowns/menus/options'; // Import letters from the options file

export default function LetterDropdown({ onSelectLetter }) {
  return (
    <div className="select-container">
      <label htmlFor="letter-dropdown">Select a letter</label>
      <Select
        id="letter-dropdown"
        options={letters} // Use letters as options
        onChange={onSelectLetter}
        placeholder="Select letter..."
      />
    </div>
  );
}
